import React from 'react';
import { Document, Page, Text, View, StyleSheet } from '@react-pdf/renderer';

const styles = StyleSheet.create({
  page: {
    flexDirection: 'column',
    backgroundColor: '#ffffff',
    padding: 30,
  },
  section: {
    margin: 10,
    padding: 10,
    flexGrow: 1,
  },
  companyInfo: {
    marginBottom: 20,
  },
  companyName: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  companyDetails: {
    fontSize: 10,
    marginBottom: 3,
  },
  title: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
    textAlign: 'center',
  },
  orderInfo: {
    marginBottom: 20,
  },
  orderInfoItem: {
    fontSize: 12,
    marginBottom: 5,
  },
  table: { 
    display: "table", 
    width: "auto", 
    borderStyle: "solid", 
    borderWidth: 1, 
    borderRightWidth: 0, 
    borderBottomWidth: 0 
  },
  tableRow: { 
    margin: "auto", 
    flexDirection: "row" 
  },
  tableColHeader: { 
    width: "16.66%", 
    borderStyle: "solid", 
    borderWidth: 1, 
    borderLeftWidth: 0, 
    borderTopWidth: 0,
    backgroundColor: '#f0f0f0',
  },
  tableCol: { 
    width: "16.66%", 
    borderStyle: "solid", 
    borderWidth: 1, 
    borderLeftWidth: 0, 
    borderTopWidth: 0 
  },
  tableCellHeader: {
    margin: 5,
    fontSize: 10,
    fontWeight: 'bold',
  },
  tableCell: { 
    margin: 5, 
    fontSize: 8 
  },
  summary: {
    marginTop: 20,
    borderTop: 1,
    paddingTop: 10,
  },
});

const OrderPDF = ({ lineItems, totalGarmentQuantity, totalCapQuantity, totalPrice, customerName, orderDate, orderNumber }) => {
  const subtotal = totalPrice || 0;
  const salesTax = subtotal * 0.101; // 10.1% sales tax
  const total = subtotal + salesTax;

  return (
    <Document>
      <Page size="A4" style={styles.page}>
        <View style={styles.companyInfo}>
          <Text style={styles.companyName}>Northwest Custom Apparel</Text>
          <Text style={styles.companyDetails}>2025 Freeman Road East, Milton, WA 98354</Text>
          <Text style={styles.companyDetails}>Phone: 253-922-5792</Text>
          <Text style={styles.companyDetails}>Website: www.nwcustomapparel.com</Text>
        </View>

        <Text style={styles.title}>Invoice</Text>

        <View style={styles.orderInfo}>
          <Text style={styles.orderInfoItem}>Customer Name: {customerName}</Text>
          <Text style={styles.orderInfoItem}>Order Date: {orderDate}</Text>
          <Text style={styles.orderInfoItem}>Order Number: {orderNumber}</Text>
        </View>
        
        <View style={styles.table}>
          <View style={styles.tableRow}>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Style</Text>
            </View>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Color</Text>
            </View>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Description</Text>
            </View>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Sizes</Text>
            </View>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Quantity</Text>
            </View>
            <View style={styles.tableColHeader}>
              <Text style={styles.tableCellHeader}>Total</Text>
            </View>
          </View>
          {lineItems.map((item, index) => (
            <View style={styles.tableRow} key={index}>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>{item.styleNo || ''}</Text>
              </View>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>{item.colorName || ''}</Text>
              </View>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>{item.productTitle || ''}</Text>
              </View>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>
                  {Object.entries(item.quantities || {}).map(([size, qty]) => 
                    qty > 0 ? `${size}: ${qty}` : ''
                  ).filter(Boolean).join(', ')}
                </Text>
              </View>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>{item.totalQuantity || 0}</Text>
              </View>
              <View style={styles.tableCol}>
                <Text style={styles.tableCell}>${(item.subtotal || 0).toFixed(2)}</Text>
              </View>
            </View>
          ))}
        </View>

        <View style={styles.summary}>
          <Text>Subtotal: ${subtotal.toFixed(2)}</Text>
          <Text>Sales Tax (10.1%): ${salesTax.toFixed(2)}</Text>
          <Text style={{ fontWeight: 'bold' }}>Total: ${total.toFixed(2)}</Text>
        </View>
      </Page>
    </Document>
  );
};

export default OrderPDF;
